with open("honors-img.html", "r") as f:
    html_doc = f.read().replace('\n', '')

soup = BeautifulSoup(html_doc)

d = dict()
for a in soup.find_all('a'):
    try:
        tab = a.get('href').split("&")[2].split("=")[1]
        honorName = a.get('title')
        honorId = a.get('href').split("&")[1].split("=")[1]
        imgId = a.find('img').get("src").split("/")[-1].split(".")[0]
        d[honorId] = [imgId, honorName]
    except:
        try:
            honorName = a.find('span').string
            for k, v in HONORS.items():
                if v["name"] == honorName:
                    honorId = k
            # honorId = a.get('href').split("&")[1].split("=")[1]
            # imgId = a.find('img').get("src").split("/")[-1].split(".")[0]
            d[honorId] = [0, honorName]
            print("pass {}".format(honorName))
        except:
            pass

with open("honors-img.dat", "w+") as f:
    f.write("\t\t# {}\n".format(tab))
    for k, v in d.items():
        f.write("\t\t{}: {},  # {}\n".format(k, v[0], v[1]))
